import React from 'react';
import './Projects.scss'

const Projects = () => {
    return (
        <section className='section__projects'>
            <div className='container container__projects'>
                <div className='title__projects'>
                    <h2>My projects</h2>
                </div>
                <div className='projects__cards'>
                    <div className='card'>
                            <h3>LandingPage</h3>
                        <div className='card__body'>
    <img src='./javascript-2.svg'/>
                            <p>Описание</p>
                            <button className='project_btn'>Look project</button>
                        </div>
                    </div>
                    <div className='card'>Project Two</div>
                    <div className='card'>Project three</div>
                </div>
            </div>
        </section>
    );
};

export default Projects;
